import React from "react";
import { Link } from "react-router-dom";

// モックデータ（実際にはAPIから取得する）
const mockQAList = [
    { qa_id: 101, title: "日本の地理問題" },
    { qa_id: 102, title: "物理基礎" },
];

const QAList: React.FC = () => {
    return (
        <div>
            <h1>QA一覧</h1>
            <ul>
                {mockQAList.map((qa) => (
                    <li key={qa.qa_id}>
                        <Link to={`/qa/${qa.qa_id}`}>{qa.title}</Link>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default QAList;
